// to run JSON server: npx json-server --watch data/db.json --port 8000

// import { useState, useEffect } from "react";
import NFTList from "./NFTList";
import useFetch from "./useFetch";

const NFTs = () => {

    const { data: vibes, isPending, error } = useFetch('http://localhost:8000/vibes');

    return (
        <div className="nfts">
            { error && <div> {error} </div> }
            { isPending && <div>Loading...</div> }

            {vibes && <BlogList vibes = {vibes} title="All Blogs"/>}
            {/* {vibes && <BlogList vibes = {vibes.filter((blog) => vibe.author === 'mario')} title="Mario's Vibes"/>} */}

        </div>
    );
}

export default NFTs;
